func minimumChanges(s string, k int) int {
    n := len(s)
    dp := make([][][]int, n+1)
    for i := range dp {
        dp[i] = make([][]int, n+1)
        for j := range dp[i] {
            dp[i][j] = make([]int, k+1)
            for l := range dp[i][j] {
                dp[i][j][l] = int(1e9)
            }
        }
    }
    for i := 0; i <= n; i++ {
        dp[i][i][0] = 0
    }

    for length := 1; length <= n; length++ {
        for i := 0; i+length <= n; i++ {
            j := i + length
            for d := 1; d <= length; d++ {
                if length%d == 0 {
                    changes := 0
                    for k := i; k < j; k += d {
                        maxFreq := 0
                        count := make(map[byte]int)
                        for l := k; l < j; l += d {
                            count[s[l]]++
                            maxFreq = max(maxFreq, count[s[l]])
                        }
                        changes += (j-i)/d - maxFreq
                    }
                    dp[i][j][1] = min(dp[i][j][1], changes)
                }
            }
            for x := 2; x <= k; x++ {
                for m := i + 1; m < j; m++ {
                    for y := 1; y < x; y++ {
                        dp[i][j][x] = min(dp[i][j][x], dp[i][m][y]+dp[m][j][x-y])
                    }
                }
            }
        }
    }

    return dp[0][n][k]
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
